  false,\n\t\"url\": null,\n\t\"notes\": \"This data set was collected as part of
  the Joint Monitoring Program during seismic activities in the Chukchi Sea. The 2006
  data was collected by ship and aircraft as part of the Joint Monitoring Program
  during seismic activities in the Chukchi Sea in summer and fall of 2006. The 2007
  data was collected by ship as part of the Marine Mammal Monitoring and Mitigation
  During Open Water Seismic Exploration program in summer and fall of 2007. The objective
  of the surveys was to update data on distribution and relative abundance of marine
  mammals in coastal areas of the eastern Chukchi Sea during the open-water season.\",\n\t\"owner_org\":
